import React from 'react';
import Backdrop from "../backdrop/backdrop";
import prompt from './prompt.module.css'

const Prompt = ({title, content}) => {
	return (
		<Backdrop send={true}>
			<div className={prompt.entire}>
				<header>{title}</header>
				
			</div>
		</Backdrop>
	);
};

export default Prompt;
